INSERT INTO `author` VALUES (1,'LJC','学生/游戏/编程','我就是我，是颜色不一样的烟火。\r\n天空开阔，要做最坚强的泡沫。','<p style=\"text-align:center\">\r\n<br/>I am what I am<br/><br/>\r\n我永远都爱这样的我<br/><br/>\r\n快乐是 快乐的方式不只一种<br/><br/>\r\n最荣幸是 谁都是造物者的光荣<br/><br/>\r\n不用闪躲 为我喜欢的生活而活<br/><br/>\r\n不用粉墨 就站在光明的角落<br/><br/>\r\n我就是我 是颜色不一样的烟火<br/><br/>\r\n天空开阔 要做最坚强的泡沫<br/><br/>\r\n我喜欢我 让蔷薇开出一种结果<br/><br/>\r\n孤独的沙漠里 一样盛放的赤裸裸<br/><br/>\r\n多么高兴 在琉璃屋中快乐生活<br/><br/>\r\n对世界说 甚么是光明和磊落<br/><br/>\r\n我就是我 是颜色不一样的烟火<br/><br/>\r\n天空开阔 要做最坚强的泡沫<br/><br/>\r\n我喜欢我 让蔷薇开出一种结果<br/><br/>\r\n孤独的沙漠里 一样盛放的赤裸裸<br/><br/><br/>\r\n<span style=\"font-style:oblique;font-weight:600\">______by 林夕 & 张国荣</span>\r\n</p>','《我》');
/*!40000 ALTER TABLE `author` ENABLE KEYS */;
UNLOCK TABLES;

