INSERT INTO `post` VALUES (1,1525015427338,'LJC','2018-04-29',NULL,NULL,'diary','从小学六年级到大二之人生第一篇博文','这是人生第一篇博文，发表在自己写的博客网站上。第一次看见“博客”这个名词是在《小学作文精选》这类书上，那时候读小学六年级。后来就没有接触过博客这种东西了。','<p>这是人生第一篇博文，发表在自己写的博客网站上。第一次看见“博客”这个名词是在《小学作文精选》这类书上，那时候读小学六年级。后来就没有接触过博客这种东西了。直到上了高中，叛逆的我崇拜一个更叛逆的人，他叫韩寒。在了解他的事迹、关注他的微博、看过他的电影、读遍他的小说之后，我还浏览了他的博客。</p><p>然后呢，这些跟我写这个博客网站和这篇博文没有太大关系。写了就是写了，并不没有某种梦想成真的喜悦。甚至成就感仅来自于我独立完成了逻辑不算太简单的网站前台展示后台管理的设计以及前端界面后端逻辑的编写。</p><p>写这个网站满打满算花了整整十七天，当然不包括吃饭睡觉上课的时间。从13号开始写，到今晚（29号），有时候写到怀疑人生。因为，几乎是一边学一边写的，在此感谢万能的百度，还有那个叫bootstrap的前端框架，还有很多要感谢的啊。网站的编写使用了html+php+js语言，运行在lamp环境下。不多说了，附上源码地址：<br/>\r\nhttps://github.com/lanjiacheng/my_blog.git\r\n</p><p>写网站的初衷是练一下手，后来觉得它大有可为。我想用这个博客记录下我的素日见闻、平生足迹、编程心得、以及粗鄙见识。过去的美好已经来不及细写，往后的琐屑将暂刻于此。</p>',32,1),(6,1525789250609,'LJC','2018-05-08',NULL,NULL,'programme','CSS中的html定位','CSS不仅仅能够定义html元素的显示效果，还能够定义html元素的位置。定义html元素的位置，是CSS的一大应用实例。一个复杂的html页面\r\n往往离不开CSS的定位效果。CSS定位主要用到几个属性display、position以及float，掌握这几个属性，加以灵活运用，就可以设计出布局\r\n丰富多样的html页面。','<h3>理解CSS中的html定位，需要先搞清几点知识和概念：</h3><p><br/>1.默认情况下html中的任何元素都以一个盒子模型的形式显示。块级元素是一个独立的盒子，多个连续的（或单个独立的）内联元素是一个单独的盒子。<br/>\r\n2.默认情况下html中的元素都包含在普通文档流中。块级元素的普通流为从上到下竖直排列，内联元素的普通流为从左到右水平排列（碰到外层盒子会折行显示）<br/></p><h3>CSS中实现元素定位的方法：</h3><p><br/>1.通过定义position属性：\r\n<br/>static：定义position属性值为static，就是默认效果，元素仍处于普通文档流默认位置，与不定义position属性无异。\r\n<br/>relative：定义position属性值为relative，目标元素在文档流中的空间仍存在（未脱离，以空白填充），但是可以根据left或top等属性确定目标元素相对于它在原来的普通文档流中的位置的偏移量。\r\n<br/>absolute：定义position属性为absolute，目标元素脱离普通文档流，存在于文档流中的空间消失，相当于html中没有该元素。但可以通过定义left或top等属性确定目标元素相对于它的父元素（容器）的位置。\r\n<br/>fixed：fixed属性的效果与absolute属性效果类似，但是它总以视窗为父元素（容器），所定义偏移位置都是相对于当前视窗位置而言的。<br/></p><p><br/>2.通过定义float属性：\r\n<br/>可以定义float属性为left、right来决定元素的浮动方向。当目标元素的float属性被定义时，他将脱离普通文档流。浮动的元素会按浮动方向进行浮动，若碰到同样是浮动的元素就会停止，若碰到视窗边缘就会折行显示（到下一行显示）。同时可以通过clear属性来定义文档流中的段落的某一边不能触碰到浮动元素。clear属性值可为left或right。该属性的效果往往是使段落元素向下移动，以使其左边或右边与浮动文档错开（不在同一水平位置重叠）。</p>',4,1);
